using AutoMapper;
using Google.Api.Gax;
using MicrobUy_API.Dtos;
using MicrobUy_API.Models;
using Microsoft.AspNetCore.Identity;


namespace MicrobUy_API.Data.SeedData
{
    public class SeedPlataformUsers
    {
        private static TenantAplicationDbContext _context;
        private static UserManager<IdentityUser> _userManager;
        private static IMapper _mapper;


        public static void RunSeedUserPlataform(TenantAplicationDbContext context, UserManager<IdentityUser> userManager, IMapper mapper)
        {
            _context = context;
            _userManager = userManager;
            _mapper = mapper;

            try
            {
                if (!_context.User.Any())
                {
                    var plataformUsers = new List<UserRegistrationRequestDto>
                {
                   new UserRegistrationRequestDto
                    {
                        FirstName = "John",
                        LastName = "Doe",
                        ProfileImage = "data:image/jpeg;base64,",
                        Biography = "Software Engineer",
                        Occupation = "Developer",
                        City = new CityRequestDto { Name = "Montevideo" },
                        Birthday = new DateTime(1990, 5, 15),
                        IsSanctioned = false,
                        Email = "john.doe@example.com",
                        Username = "john_doe@microbuy",
                        Password = "Pepe_123",
                        ConfirmPassword = "Pepe_123",
                        Role = "Platform-Administrator",
                        Active = true
                    },

                   new UserRegistrationRequestDto
                   {
                       FirstName = "Jane",
                       LastName = "Smith",
                       ProfileImage = "data:image/jpeg;base64,",
                       Biography = "Marketing Specialist",
                       Occupation = "Marketing",
                       City = new CityRequestDto { Name = "Young" },
                       Birthday = new DateTime(1985, 8, 22),
                       IsSanctioned = false,
                       Email = "jane.smith@example.com",
                       Username = "jane_smith@microbuy",
                       Password = "Pepe_123",
                       ConfirmPassword = "Pepe_123",
                       Role = "Platform-Administrator",
                       Active = true
                   },

                   new UserRegistrationRequestDto
                    {
                        FirstName = "Alice",
                        LastName = "Jackson",
                        ProfileImage = "data:image/jpeg;base64,",
                        Biography = "Data Scientist",
                        Occupation = "Data Science",
                        City = new CityRequestDto { Name = "Pando" },
                        Birthday = new DateTime(1988, 11, 8),
                        IsSanctioned = false,
                        Email = "alice.jackson@example.com",
                        Username = "alice_jackson@microbuy",
                        Password = "Pepe_123",
                        ConfirmPassword = "Pepe_123",
                        Role = "Platform-Administrator",
                        Active = true
                    }
                };

                    foreach (var usr in plataformUsers)
                    {
                        IdentityUser user = _mapper.Map<IdentityUser>(usr);

                        Task<IdentityResult> task = Task.Run<IdentityResult>(async () => await _userManager.CreateAsync(user, usr.Password));
                        var result = task.Result;
                        Task<IdentityResult> taskRole = Task.Run<IdentityResult>(async () => await _userManager.AddToRoleAsync(user, usr.Role));
                        var resultRole = taskRole.Result;

                        if (result.Succeeded && resultRole.Succeeded)
                        {
                            UserModel newUser = _mapper.Map<UserModel>(usr);
                            _context.Add(newUser);
                        }
                    }

                    _context.SaveChanges();
                }
            }
            catch (Exception ex)
            {

                throw ex;
            }
        }
    }
}
